IF OBJECT_ID('dbo.proc_transform_286', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_286;
GO
CREATE PROCEDURE dbo.proc_transform_286
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_286
    SET payload = LEFT(payload, 1000) + N'|V4-286|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_286;
END
